import {StyleSheet} from 'react-native';

export default StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#8E44AD',
        alignItems: 'center',
        justifyContent: 'center'
    },
    title: {
        fontSize: '2rem',
        color: '#FECA57'
    },
    card: {
        width: '90%',
        height: '10%',
        backgroundColor: '#C8D6E5',
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-between'
    }
});
